import React from 'react';
import {
  BrowserRouter as Router,
  Route,
  Routes,
} from 'react-router-dom';
import Planechase from './planechase/Planechase';
import NewSession from './planechase/NewSession';
import MakePlanarDeck from './make-planar-deck';

export default function App() {

  return (
    <Router>
      <Routes>
        <Route path="/" element={<NewSession />} />
        <Route path="/search" element={<MakePlanarDeck />} />
        <Route path="/:inputSessionCode" element={<Planechase />} />
      </Routes>
    </Router>
  );
}
